import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Vinland from './Page/Vinland';
import Miror from './Page/Miror';
import DemonSlayer from './Page/DemonSlayer';
import './App.css';

function App() {
  return (
    <Router>
      <nav>
        <ul>
          <li><Link to="/vinland">Vinland</Link></li>
          <li><Link to="/miror">Miror</Link></li>
          <li><Link to="/demonSlayer">DemonSlayer</Link></li>
        </ul>
      </nav>
      <Routes>
        <Route path="/vinland" element={<Vinland />} />
        <Route path="/miror" element={<Miror />} />
        <Route path="/demonSlayer" element={<DemonSlayer />} />
      </Routes>
    </Router>
  );
}

export default App;
